Muran (English: Conflict) is a 2011 Indian Tamil thriller film written and directed by debutant Rajjan Madhav.[2] It stars Cheran alongside Prasanna, with Nikita Thukral, Haripriya and Jayaprakash in pivotal roles. Launched in September 2010,[3] the film's shooting was completed by July 2011.[4] The story revolves around two contrasting characters and depicts the incidents that occur when they meet each other.[5] The film was supposed to be based on Alfred Hitchcock's psychological thriller Strangers on a Train (1951). Co-produced and distributed by UTV Motion Pictures,[6] Muran was released on September 30, 2011 to overall positive reviews.
[edit]Cast

Prasanna as Arjun Devarajan
Cheran as Nanda
Nikita Thukral as Indhu
Haripriya as Lavanya
Suma Bhattacharya as Linda
Jayaprakash as Devarajan
Prathap Pothan
Neelima Rani

STORY / PLOT:

After finishing a successful meeting with his movie producers in Bangalore, Nanda, a jingles composer catches the highway to Chennai. On his way his car breaks down and he hitchhikes with Arjun, a businessman's son on his way to the same destination. During their journey together they discuss their personal lives till Arjun proposes a deal; a deal that is marked with murder but promises to better their personal lives. However this deal does not work in Nanda's favor and he soon finds himself in deeper complications.

